import { Form, Button, Dropdown, Checkbox } from 'semantic-ui-react';

export function AddEditStudentForm() {
  return (
    <Form className='add-edit-student-form'>
        <Form.Input name="name" placeholder="Nombre" />
        <Form.Input name="paternal" placeholder="Apellido paterno" />
        <Form.Input name="maternal" placeholder="Apellido materno" />
        <Dropdown placeholder='Curso' fluid selection search />
        <Form.Input name="nameApoderado" placeholder="Nombre Apoderado" />
        <Form.Input name="address_street" placeholder="Nombre" />
        <Form.Input name="address_number" placeholder="Nombre" />
        

    </Form>
  )
}
